import React from 'react'
import { useState, useEffect } from 'react'

function Products() {
    const [product, setproduct] = useState();

    useEffect(() => {
        fetch('https://fakestoreapi.com/products')

            .then(res => res.json())
            .then(data => {
                setproduct(data)
            })  
    }, [])
    return (
        <div>
            <h1>Products</h1>
            {product && product.map(item => (item.title))}
        </div>
    )
}

export default Products
